rendi a programar Basic num ZX Spectrum... Com idade para ser meu pai, fosse eu um computador e os chips se auto-multiplicassem! Numa tarde solarenga, aprendi o Basic!<br \\/>E as coincid\\u00eancias continuaram... Aprendi que gostava de caf\\u00e9... N\\u00e3o de Coffee Script, mas de caf\\u00e9 de beber... Pouco depois aprendi Java! Com caf\\u00e9, ou sem ele! ;)<\\/p><p>N\\u00e3o contente, aprendi Cobol, homenageando o meu fasc\\u00ednio por dinossauros. Foi o mais pr\\u00f3ximo que consegui de me \\"tornar um\\"!<br \\/>Mas a busca n\\u00e3o para e n\\u00e3o se \\u00e9 crian\\u00e7a para sempre... Aprendi Pascal... Apesar de n\\u00e3o falar franc\\u00eas (Perdoa-me Blaise Pascal)!<br \\/>Aprendi C e C++ que \\u00e9 como quem diz \\"C\\"atarina e \\"C\\"atarina muito mais\\" (C++), quase press\\u00e1gio do que iria ser!<\\/p><p>Aprendi ainda mais... Aprendi ECMAScript e PHP, mas pra qu\\u00ea ? Para aprender mais ainda!<\\/p><p>De professora a aprendiz... Aprendi mais e mais... Nunca quieta, mas sempre despachada, aprendi de tudo um pouco, e do muito descobri, que tudo o que aprendi era nada... Comparado com o que viria a aprender!<br \\/>com um Ar pequenino aprendi a montar circuitos num Ar...Duino! E com ele ensinei rob\\u00f3tica!<\\/p><p>Ainda com muito para aprender, mas sempre com muita vontade, mais do que um professor de \\"prateleira\\", sou aprendiz de verdade! Tornei-me aprendiz, para sempre aprender... <br \\/>Mais que \\"mais mais\\", serei Catarina, em todas as itera\\u00e7\\u00f5es, aprendiz, professora, mente inquieta, talvez \\"Stora\\", algu\\u00e9m que se recusou a baixar os bra\\u00e7os... E aprendeu cada vez mais!<br \\/>A menina das coincid\\u00eancias, de mente agu\\u00e7ada (sharp), e de nome Catarina, aprendi C#, mas senti-me pequenina!<\\/p><p>No futuro ainda quero aprender Rust(ferrugem), ainda que n\\u00e3o esteja enferrujada!<\\/p><p>Ainda quero aprender Maple, mas apenas por piada! (Prometo n\\u00e3o cometer o mesmo bug)! Haja quem entenda a piada! Talvez muito poucos, mas os poucos ser\\u00e3o muitos, a perceber o bug, de 1994!<br \\/>N\\u00e3o era o Y2k, era mesmo o MSUD, um bug de \\"overflow\\"... O bug que me lixou!<\\/p><p>Tenho tanto para aprender, e tanto para ensinar, fa\\u00e7o minhas as palavras do s\\u00e1bio que diz que a melhor forma de ensinar \\u00e9 aprender, para aprender o que posso e ensinar o que sei!<\\/p><p>Sou a mente inquieta que nasci, aprenderei tudo o que serei!<\\/p><p>Com 8 bits ou bytes, vou escrevendo alguns bitaites! Contando a hist\\u00f3ria de um professor, que se tornou programador! Colecionador de retro-computing de 8 bits animados, quem diria que se descreve o mundo...<br \\/>Em poucos quadrados! Oito por oito, diga-se em verdade, assim se compunham as imagens, na \\"antiguidade\\"!<br \\/>A cole\\u00e7\\u00e3o deu mote, ao site que escrevo, Catarina 8Bits! Uma homenagem ao tempo onde com pouco se fazia muito e na simplicidade se escrevia a beleza e com apenas 8 pequeninos bits, se fazia magia!<\\/p>"},"elements":[],"widgetType":"text-editor"}],"isInner":false}],"isInner":false}]'),
