itos, a perceber o bug, de 1994!<br \\/>N\\u00e3o era o Y2k, era mesmo o MSUD, um bug de \\"overflow\\"... O bug que me lixou!<\\/p><p>Tenho tanto para aprender, e tanto para ensinar, fa\\u00e7o minhas as palavras do s\\u00e1bio que diz que a melhor forma de ensinar \\u00e9 aprender, para aprender o que posso e ensinar o que sei!<\\/p><p>Sou a mente inquieta que nasci, aprenderei tudo o que serei!<\\/p><p>Com 8 bits ou bytes, vou escrevendo alguns bitaites! Contando a hist\\u00f3ria de um professor, que se tornou programador! Colecionador de retro-computing de 8 bits animados, quem diria que se descreve o mundo...<br \\/>Em poucos quadrados! Oito por oito, diga-se em verdade, assim se compunham as imagens, na \\"antiguidade\\"!<br \\/>A cole\\u00e7\\u00e3o deu mote, ao site que escrevo, Catarina 8Bits! Uma homenagem ao tempo onde com pouco se fazia muito e na simplicidade se escrevia a beleza e com apenas 8 pequeninos bits, se fazia magia!<\\/p>"},"elements":[],"widgetType":"text-editor"},{"id":"adec2aa","elType":"widget","settings":{"image":{"url":"http:\\/\\/catarina8bits.epizy.com\\/wp-content\\/uploads\\/2021\\/11\\/New-Piskel-2-1.png","id":18,"alt":"","source":"library"},"image_size":"shop_thumbnail","align":"center"},"elements":[],"widgetType":"image"}],"isInner":false}],"isInner":false}]'),
