  array('ID' => '48','post_author' => '1','post_date' => '2021-11-10 10:54:26','post_date_gmt' => '2021-11-10 10:54:26','post_content' => '<!-- wp:paragraph -->
<p>Programas usados: Pixilart e Canva </p>
<!-- /wp:paragraph -->

<!-- wp:columns -->
<div class="wp-block-columns"><!-- wp:column {"width":"100%"} -->
<div class="wp-block-column" style="flex-basis:100%"><!-- wp:columns -->
<div class="wp-block-columns"><!-- wp:column {"width":"100%"} -->
<div class="wp-block-column" style="flex-basis:100%"><!-- wp:image {"align":"center","id":45,"sizeSlug":"large","linkDestination":"none"} -->
<div class="wp-block-image"><figure class="aligncenter size-large"><img src="http://catarina8bits.epizy.com/wp-content/uploads/2021/11/Catarina-8-bits-4-1024x577.png" alt="" class="wp-image-45"/><figcaption>Capa/ cabeçalho do site</figcaption></figure></div>
<!-- /wp:image --></div>
<!-- /wp:column --></div>
<!-- /wp:columns -->

<!-- wp:paragraph -->
<p></p>
<!-- /wp:paragraph --></div>
<!-- /wp:column --></div>
<!-- /wp:columns -->

<!-- wp:paragraph -->
<p>Usei o programa <a data-type="URL" data-id="https://www.pixilart.com/" href="https://www.pixilart.com/">Pixilart</a> para fazer todos os elementos em bits para a capa da página de facebook, youtube, entre outras redes.</p>
<!-- /wp:paragraph -->

<!-- wp:paragraph -->
<p>Aliado a este programa usei o<a href="https://www.canva.com/pt_pt/"> Canva</a>, é o programa mais versátil de design que uso. </p>
<!-- /wp:paragraph -->

<!-- wp:paragraph -->
<p>Podemos criar tudo em design com este programa, bem como para marketing.</p>
<!-- /wp:paragraph -->

<!-- wp:paragraph -->
<p>Esse programa usei um filtro que tem na edição de imagem (plano gratuito) para tornar algumas imagens que encontrei em .png (sem fundo) para pixelizar. </p>
<!-- /wp:paragraph -->

<!-- wp:paragraph -->
<p>Ainda assim, fiz algumas imagens sozinha em pixéis como o ZX spectrum , o símbolo do blogger e do wordpress que são plataformas que uso com frequência. </p>
<!-- /wp:paragraph -->

<!-- wp:paragraph -->
<p></p>
<!-- /wp:paragraph -->

<!-- wp:paragraph -->
<p></p>
<!-- /wp:paragraph -->

<!-- wp:paragraph -->
<p></p>
<!-- /wp:paragraph -->','post_title' => 'Criação de capas/cabeçalhos para sites','post_excerpt' => '','post_status' => 'inherit','comment_status' => 'closed','ping_status' => 'closed','post_password' => '','post_name' => '31-revision-v1','to_ping' => '','pinged' => '','post_modified' => '2021-11-10 10:54:26','post_modified_gmt' => '2021-11-10 10:54:26','post_content_filtered' => '','post_parent' => '31','guid' => 'http://catarina8bits.epizy.com/?p=48','menu_order' => '0','post_type' => 'revision','post_mime_type' => '','comment_count' => '0'),
  array('ID' => '50','post_author' => '1','post_date' => '2021-11-10 11:06:00','post_date_gmt' => '2021-11-10 11:06:00','post_content' => '<!-- wp:group -->
<div class="wp-block-group"><!-- wp:gallery {"ids":[18],"columns":1,"imageCrop":false,"linkTo":"none","align":"center"} -->
<figure class="wp-block-gallery aligncenter columns-1" id="Pixel"><ul class="blocks-gallery-grid"><li class="blocks-gallery-item"><figure><img src="http://catarina8bits.epizy.com/wp-content/uploads/2021/11/New-Piskel-2-1.png" alt="" data-id="18" data-link="http://catarina8bits.epizy.com/?attachment_id=18" class="wp-image-18"/></figure></li></ul><figcaption class="blocks-gallery-caption">Pixel art - Primeiros pixeis</figcaption></figure>
<!-- /wp:gallery --></div>
<!-- /wp:group -->

<!-- wp:paragraph -->
<p>Pixel art - Primeiros pixeis</p>
<!-- /wp:paragraph -->

<!-- wp:paragraph -->
<p>Hoje dei os primeiros passos em Pixel art, usando o programa <a data-type="URL" data-id="https://www.piskelapp.com/" href="https://www.piskelapp.com/">Piskelapp</a> dei os primeiros toques com a minha pokédex para poder criar  a identidade do meu site. </p>
<!-- /wp:paragraph -->

<!-- wp:paragraph -->
<p>Foram os primeiros rabiscos em pixéis para criar o robot 8 bits. </p>
<!-- /wp:paragraph -->

<!-- wp:paragraph -->
<p>Procurando uma identidade ligada á robótica que me identificasse como marca desta minha aventura pela tecnologia e tornar-me no Geek.</p>
