er mais ainda!</p><p>De professora a aprendiz... Aprendi mais e mais... Nunca quieta, mas sempre despachada, aprendi de tudo um pouco, e do muito descobri, que tudo o que aprendi era nada... Comparado com o que viria a aprender!<br />com um Ar pequenino aprendi a montar circuitos num Ar...Duino! E com ele ensinei robótica!</p><p>Ainda com muito para aprender, mas sempre com muita vontade, mais do que um professor de "prateleira", sou aprendiz de verdade! Tornei-me aprendiz, para sempre aprender... <br />Mais que "mais mais", serei Catarina, em todas as iterações, aprendiz, professora, mente inquieta, talvez "Stora", alguém que se recusou a baixar os braços... E aprendeu cada vez mais!<br />A menina das coincidências, de mente aguçada (sharp), e de nome Catarina, aprendi C#, mas senti-me pequenina!</p><p>No futuro ainda quero aprender Rust(ferrugem), ainda que não esteja enferrujada!</p><p>Ainda quero aprender Maple, mas apenas por piada! (Prometo não cometer o mesmo bug)! Haja quem entenda a piada! Talvez muito poucos, mas os poucos serão muitos, a perceber o bug, de 1994!<br />Não era o Y2k, era mesmo o MSUD, um bug de "overflow"... O bug que me lixou!</p><p>Tenho tanto para aprender, e tanto para ensinar, faço minhas as palavras do sábio que diz que a melhor forma de ensinar é aprender, para aprender o que posso e ensinar o que sei!</p><p>Sou a mente inquieta que nasci, aprenderei tudo o que serei!</p><p>Com 8 bits ou bytes, vou escrevendo alguns bitaites! Contando a história de um professor, que se tornou programador! Colecionador de retro-computing de 8 bits animados, quem diria que se descreve o mundo...<br />Em poucos quadrados! Oito por oito, diga-se em verdade, assim se compunham as imagens, na "antiguidade"!<br />A coleção deu mote, ao site que escrevo, Catarina 8Bits! Uma homenagem ao tempo onde com pouco se fazia muito e na simplicidade se escrevia a beleza e com apenas 8 pequeninos bits, se fazia magia!</p>		
