  array('ID' => '81','post_author' => '1','post_date' => '2021-11-17 22:01:54','post_date_gmt' => '2021-11-17 22:01:54','post_content' => '<p><img src="http://catarina8bits.epizy.com/wp-content/uploads/2021/11/pixton-avatar-full-body-150x300.png" alt="" width="150" height="300" />#include stdio.h</p><p>int main()<br />{<br />if (data == "29/04/1994") <br />{<br />printf("Hello World!n");<br />}</p><p>Podia ser assim que começava o "Sobre mim", mas faltavam uns quantos terabytes de código genético, com bugs!</p><p>Em suma, sou a Catarina (não, não sou o Mac OS X 10.15 Catalina), sou mesmo a Catarina! Poderia ser a Grande, mas sou Grande, apesar de pequenina!</p><p>Mente iNquieta, iMparável, iNcansável na sua busca pelo conhecimento, mas apesar de tantos "i", não sou um "produto Apple", nem gosto de maças!<br />Professora de formação inicial, por coincidência em ensino da  língua e que o meu nome dá o nome a uma das versões do sistema operativo da Apple (Mac OS 10.15), tanta coincidência...</p><p>Inconformada, fiz dos limões que a vida me deu, em forma de pandemia, e fiz uma bateria! Que é como quem diz "uma bateria de formações", que me levou a aperceber a paixão que tenho pela tecnologia!<br />Quando nasci o mundo dava as boas vindas ao nascimento do sistema operativo que haveria de o mudar... Não! Não era da Apple, era da Microsoft! Em 1994, o mundo daria as boas vindas ao Windows 95!<br />Eu só o conheceria mais tarde, mas cedo me fascinou!</p><p>Aprendi a programar Basic num ZX Spectrum... Com idade para ser meu pai, fosse eu um computador e os chips se auto-multiplicassem! Numa tarde solarenga, aprendi o Basic!<br />E as coincidências continuaram... Aprendi que gostava de café... Não de Coffee Script, mas de café de beber... Pouco depois aprendi Java! Com café, ou sem ele! ;)</p><p>Não contente, aprendi Cobol, homenageando o meu fascínio por dinossauros. Foi o mais próximo que consegui de me "tornar um"!<br />Mas a busca não para e não se é criança para sempre... Aprendi Pascal... Apesar de não falar francês (Perdoa-me Blaise Pascal)!<br />Aprendi C e C++ que é como quem diz "C"atarina e "C"atarina muito mais" (C++), quase presságio do que iria ser!</p><p>Aprendi ainda mais... Aprendi ECMAScript e PHP, mas pra quê ? Para aprender mais ainda!</p><p>De professora a aprendiz... Aprendi mais e mais... Nunca quieta, mas sempre despachada, aprendi de tudo um pouco, e do muito descobri, que tudo o que aprendi era nada... Comparado com o que viria a aprender!<br />com um Ar pequenino aprendi a montar circuitos num Ar...Duino! E com ele ensinei robótica!</p><p>Ainda com muito para aprender, mas sempre com muita vontade, mais do que um professor de "prateleira", sou aprendiz de verdade! Tornei-me aprendiz, para sempre aprender... <br />Mais que "mais mais", serei Catarina, em todas as iterações, aprendiz, professora, mente inquieta, talvez "Stora", alguém que se recusou a baixar os braços... E aprendeu cada vez mais!<br />A menina das coincidências, de mente aguçada (sharp), e de nome Catarina, aprendi C#, mas senti-me pequenina!</p><p>No futuro ainda quero aprender Rust(ferrugem), ainda que não esteja enferrujada!</p><p>Ainda quero aprender Maple, mas apenas por piada! (Prometo não cometer o mesmo bug)! Haja quem entenda a piada! Talvez muito poucos, mas os poucos serão muitos, a perceber o bug, de 1994!<br />Não era o Y2k, era mesmo o MSUD, um bug de "overflow"... O bug que me lixou!</p><p>Tenho tanto para aprender, e tanto para ensinar, faço minhas as palavras do sábio que diz que a melhor forma de ensinar é aprender, para aprender o que posso e ensinar o que sei!</p><p>Sou a mente inquieta que nasci, aprenderei tudo o que serei!</p><p>Com 8 bits ou bytes, vou escrevendo alguns bitaites! Contando a história de um professor, que se tornou programador! Colecionador de retro-computing de 8 bits animados, quem diria que se descreve o mundo...<br />Em poucos quadrados! Oito por oito, diga-se em verdade, assim se compunham as imagens, na "antiguidade"!<br />A coleção deu mote, ao site que escrevo, Catarina 8Bits! Uma homenagem ao tempo onde com pouco se fazia muito e na simplicidade se escrevia a beleza e com apenas 8 pequeninos bits, se fazia magia!</p>		
															<img width="100" height="100" src="http://catarina8bits.epizy.com/wp-content/uploads/2021/11/New-Piskel-2-1.png" alt="" loading="lazy" srcset="http://catarina8bits.epizy.com/wp-content/uploads/2021/11/New-Piskel-2-1.png 180w, http://catarina8bits.epizy.com/wp-content/uploads/2021/11/New-Piskel-2-1-100x100.png 100w, http://catarina8bits.epizy.com/wp-content/uploads/2021/11/New-Piskel-2-1-150x150.png 150w" sizes="(max-width: 100px) 100vw, 100px" />','post_title' => 'Sobre mim','post_excerpt' => '','post_status' => 'inherit','comment_status' => 'closed','ping_status' => 'closed','post_password' => '','post_name' => '40-revision-v1','to_ping' => '','pinged' => '','post_modified' => '2021-11-17 22:01:54','post_modified_gmt' => '2021-11-17 22:01:54','post_content_filtered' => '','post_parent' => '40','guid' => 'http://catarina8bits.epizy.com/?p=81','menu_order' => '0','post_type' => 'revision','post_mime_type' => '','comment_count' => '0'),
