  array('note_id' => '9','name' => 'woocommerce-services','type' => 'info','locale' => 'en_US','title' => 'WooCommerce Shipping & Tax','content' => 'WooCommerce Shipping &amp; Tax helps get your store “ready to sell” as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.','content_data' => '{}','status' => 'pending','source' => 'woocommerce.com','date_created' => '2021-11-09 16:38:40','date_reminder' => NULL,'is_snoozable' => '0','layout' => 'plain','image' => '','is_deleted' => '0','icon' => 'info'),
  array('note_id' => '10','name' => 'ecomm-unique-shopping-experience','type' => 'info','locale' => 'en_US','title' => 'For a shopping experience as unique as your customers','content' => 'Product Add-Ons allow your customers to personalize products while they’re shopping on your online store. No more follow-up email requests—customers get what they want, before they’re done checking out. Learn more about this extension that comes included in your plan.','content_data' => '{}','status' => 'pending','source' => 'woocommerce.com','date_created' => '2021-11-09 16:38:40','date_reminder' => NULL,'is_snoozable' => '0','layout' => 'plain','image' => '','is_deleted' => '0','icon' => 'info'),
  array('note_id' => '11','name' => 'wc-admin-getting-started-in-ecommerce','type' => 'info','locale' => 'en_US','title' => 'Getting Started in eCommerce - webinar','content' => 'We want to make eCommerce and this process of getting started as easy as possible for you. Watch this webinar to get tips on how to have our store up and running in a breeze.','content_data' => '{}','status' => 'pending','source' => 'woocommerce.com','date_created' => '2021-11-09 16:38:40','date_reminder' => NULL,'is_snoozable' => '0','layout' => 'plain','image' => '','is_deleted' => '0','icon' => 'info'),
  array('note_id' => '12','name' => 'your-first-product','type' => 'info','locale' => 'en_US','title' => 'Your first product','content' => 'That\'s huge! You\'re well on your way to building a successful online store — now it’s time to think about how you\'ll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href="https://href.li/?https://woocommerce.com/shipping" target="_blank">WooCommerce Shipping</a>.','content_data' => '{}','status' => 'pending','source' => 'woocommerce.com','date_created' => '2021-11-09 16:38:40','date_reminder' => NULL,'is_snoozable' => '0','layout' => 'plain','image' => '','is_deleted' => '0','icon' => 'info'),
  array('note_id' => '13','name' => 'wc-square-apple-pay-boost-sales','type' => 'marketing','locale' => 'en_US','title' => 'Boost sales with Apple Pay','content' => 'Now that you accept Apple Pay® with Square you can increase conversion rates by letting your customers know that Apple Pay® is available. Here’s a marketing guide to help you get started.','content_data' => '{}','status' => 'pending','source' => 'woocommerce.com','date_created' => '2021-11-09 16:38:40','date_reminder' => NULL,'is_snoozable' => '0','layout' => 'plain','image' => '','is_deleted' => '0','icon' => 'info'),
  array('note_id' => '14','name' => 'wc-square-apple-pay-grow-your-business','type' => 'marketing','locale' => 'en_US','title' => 'Grow your business with Square and Apple Pay ','content' => 'Now more than ever, shoppers want a fast, simple, and secure online checkout experience. Increase conversion rates by letting your customers know that you now accept Apple Pay®.','content_data' => '{}','status' => 'pending','source' => 'woocommerce.com','date_created' => '2021-11-09 16:38:40','date_reminder' => NULL,'is_snoozable' => '0','layout' => 'plain','image' => '','is_deleted' => '0','icon' => 'info'),
  array('note_id' => '15','name' => 'wcpay-apple-pay-is-now-available','type' => 'marketing','locale' => 'en_US','title' => 'Apple Pay is now available with WooCommerce Payments!','content' => 'Increase your conversion rate by offering a fast and secure checkout with <a href="https://woocommerce.com/apple-pay/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_applepay" target="_blank">Apple Pay</a>®. It’s free to get started with <a href="https://woocommerce.com/payments/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_applepay" target="_blank">WooCommerce Payments</a>.','content_data' => '{}','status' => 'pending','source' => 'woocommerce.com','date_created' => '2021-11-09 16:38:40','date_reminder' => NULL,'is_snoozable' => '0','layout' => 'plain','image' => '','is_deleted' => '0','icon' => 'info'),
