  array('note_id' => '22','name' => 'wcpay_instant_deposits_gtm_2021','type' => 'marketing','locale' => 'en_US','title' => 'Get paid within minutes – Instant Deposits for WooCommerce Payments','content' => 'Stay flexible with immediate access to your funds when you need them – including nights, weekends, and holidays. With <a href="https://woocommerce.com/products/woocommerce-payments/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_instant_deposits">WooCommerce Payments\'</a> new Instant Deposits feature, you’re able to transfer your earnings to a debit card within minutes.','content_data' => '{}','status' => 'pending','source' => 'woocommerce.com','date_created' => '2021-11-09 16:38:41','date_reminder' => NULL,'is_snoozable' => '0','layout' => 'plain','image' => '','is_deleted' => '0','icon' => 'info'),
  array('note_id' => '23','name' => 'google_listings_and_ads_install','type' => 'marketing','locale' => 'en_US','title' => 'Drive traffic and sales with Google','content' => 'Reach online shoppers to drive traffic and sales for your store by showcasing products across Google, for free or with ads.','content_data' => '{}','status' => 'pending','source' => 'woocommerce.com','date_created' => '2021-11-09 16:38:41','date_reminder' => NULL,'is_snoozable' => '0','layout' => 'plain','image' => '','is_deleted' => '0','icon' => 'info'),
  array('note_id' => '24','name' => 'wc-subscriptions-security-update-3-0-15','type' => 'info','locale' => 'en_US','title' => 'WooCommerce Subscriptions security update!','content' => 'We recently released an important security update to WooCommerce Subscriptions. To ensure your site\'s data is protected, please upgrade <strong>WooCommerce Subscriptions to version 3.0.15</strong> or later.<br /><br />Click the button below to view and update to the latest Subscriptions version, or log in to <a href="https://woocommerce.com/my-dashboard">WooCommerce.com Dashboard</a> and navigate to your <strong>Downloads</strong> page.<br /><br />We recommend always using the latest version of WooCommerce Subscriptions, and other software running on your site, to ensure maximum security.<br /><br />If you have any questions we are here to help — just <a href="https://woocommerce.com/my-account/create-a-ticket/">open a ticket</a>.','content_data' => '{}','status' => 'pending','source' => 'woocommerce.com','date_created' => '2021-11-09 16:38:41','date_reminder' => NULL,'is_snoozable' => '0','layout' => 'plain','image' => '','is_deleted' => '0','icon' => 'info'),
  array('note_id' => '25','name' => 'woocommerce-core-update-5-4-0','type' => 'info','locale' => 'en_US','title' => 'Update to WooCommerce 5.4.1 now','content' => 'WooCommerce 5.4.1 addresses a checkout issue discovered in WooCommerce 5.4. We recommend upgrading to WooCommerce 5.4.1 as soon as possible.','content_data' => '{}','status' => 'pending','source' => 'woocommerce.com','date_created' => '2021-11-09 16:38:41','date_reminder' => NULL,'is_snoozable' => '0','layout' => 'plain','image' => '','is_deleted' => '0','icon' => 'info'),
