  array('note_id' => '30','name' => 'ppxo-pps-upgrade-paypal-payments-1','type' => 'info','locale' => 'en_US','title' => 'Get the latest PayPal extension for WooCommerce','content' => 'Heads up! There\'s a new PayPal on the block!<br /><br />Now is a great time to upgrade to our latest <a href="https://woocommerce.com/products/woocommerce-paypal-payments/" target="_blank">PayPal extension</a> to continue to receive support and updates with PayPal.<br /><br />Get access to a full suite of PayPal payment methods, extensive currency and country coverage, and pay later options with the all-new PayPal extension for WooCommerce.','content_data' => '{}','status' => 'pending','source' => 'woocommerce.com','date_created' => '2021-11-09 16:38:41','date_reminder' => NULL,'is_snoozable' => '0','layout' => 'plain','image' => '','is_deleted' => '0','icon' => 'info'),
  array('note_id' => '31','name' => 'ppxo-pps-upgrade-paypal-payments-2','type' => 'info','locale' => 'en_US','title' => 'Upgrade your PayPal experience!','content' => 'We\'ve developed a whole new <a href="https://woocommerce.com/products/woocommerce-paypal-payments/" target="_blank">PayPal extension for WooCommerce</a> that combines the best features of our many PayPal extensions into just one extension.<br /><br />Get access to a full suite of PayPal payment methods, extensive currency and country coverage, offer subscription and recurring payments, and the new PayPal pay later options.<br /><br />Start using our latest PayPal today to continue to receive support and updates.','content_data' => '{}','status' => 'pending','source' => 'woocommerce.com','date_created' => '2021-11-09 16:38:41','date_reminder' => NULL,'is_snoozable' => '0','layout' => 'plain','image' => '','is_deleted' => '0','icon' => 'info'),
  array('note_id' => '32','name' => 'woocommerce-core-sqli-july-2021-need-to-update','type' => 'update','locale' => 'en_US','title' => 'Action required: Critical vulnerabilities in WooCommerce','content' => 'In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.','content_data' => '{}','status' => 'pending','source' => 'woocommerce.com','date_created' => '2021-11-09 16:38:41','date_reminder' => NULL,'is_snoozable' => '0','layout' => 'plain','image' => '','is_deleted' => '0','icon' => 'info'),
  array('note_id' => '33','name' => 'woocommerce-blocks-sqli-july-2021-need-to-update','type' => 'update','locale' => 'en_US','title' => 'Action required: Critical vulnerabilities in WooCommerce Blocks','content' => 'In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.','content_data' => '{}','status' => 'pending','source' => 'woocommerce.com','date_created' => '2021-11-09 16:38:41','date_reminder' => NULL,'is_snoozable' => '0','layout' => 'plain','image' => '','is_deleted' => '0','icon' => 'info'),
  array('note_id' => '34','name' => 'woocommerce-core-sqli-july-2021-store-patched','type' => 'update','locale' => 'en_US','title' => 'Solved: Critical vulnerabilities patched in WooCommerce','content' => 'In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.','content_data' => '{}','status' => 'pending','source' => 'woocommerce.com','date_created' => '2021-11-09 16:38:41','date_reminder' => NULL,'is_snoozable' => '0','layout' => 'plain','image' => '','is_deleted' => '0','icon' => 'info'),
  array('note_id' => '35','name' => 'woocommerce-blocks-sqli-july-2021-store-patched','type' => 'update','locale' => 'en_US','title' => 'Solved: Critical vulnerabilities patched in WooCommerce Blocks','content' => 'In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.','content_data' => '{}','status' => 'pending','source' => 'woocommerce.com','date_created' => '2021-11-09 16:38:41','date_reminder' => NULL,'is_snoozable' => '0','layout' => 'plain','image' => '','is_deleted' => '0','icon' => 'info'),
